import PropTypes from 'prop-types'
import Button1 from './Button1'
const Navbar1 = ({title}) => {
  return (
    <header><h1>{title}</h1>
        <Button1 label="Home"/>
    </header>

  )
}

Navbar1.propTypes = {
    title: PropTypes.string.isRequired,}


Navbar1.defaultProps = { title:'Task Tracker'}
export default Navbar1
